import React, { Component } from "react";
import { Row, Col } from "reactstrap";
import "./contents.css";

class Contents extends Component {
  render() {
    return (
      <div style={{ margin: 40 }}>
        <h1 style={{ color: "#ff6e6e", fontWeight: "bold" }}>
          {" "}
          {"// Contents"}
        </h1>
        <Row>
          <Col>
            <div className="box" />
          </Col>
          <Col>
            <div className="box" />
          </Col>
          <Col>
            <div className="box" />
          </Col>
        </Row>
      </div>
    );
  }
}

export default Contents;
